t51.2885-15/e35/118788010_974193543056048_1317189904330973570_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=108&_nc_ohc=qx6WynKV9_oAX_pJfbb&oh=260855e20316ed82c2dfe1be1bc23986&oe=5F54FBF3";}i:60;a:1:{s:4:"type";s:5:"video";}i:61;a:1:{s:8:"owner_id";i:38041951;}i:62;a:1:{s:14:"owner_username";s:0:"";}i:63;a:1:{s:14:"owner_fullname";s:0:"";}i:64;a:1:{s:9:"owner_pic";s:0:"";}i:65;a:1:{s:2:"id";s:19:"2391106215928123889";}i:66;a:1:{s:10:"short_code";s:11:"CEu6m9Mn9Hx";}i:67;a:1:{s:12:"created_time";i:1599262094;}i:68;a:1:{s:7:"caption";s:1813:"Hey insta, it's been awhile. I didn't plan on taking a three-month break (though it was somewhat refreshing). There are several reasons why I've hesitated to post, but the most personal is that I wasn't ready to say goodbye.  For the last two years, Ecuador has dominated my life and my feed. It felt like I could hold onto the former by preserving the latter. It's silly, I know. I'll go back to Río Negro someday, but I can't say when (ojalá cerca de la navidad). For now, I've started grad school in Colorado. After the drive out here, I have several dozen gigs weighing down my hard drive. I'm ready to start posting again, but before I do, I wanted to give the Ecuapics their due conclusion. ➡️ Ecuador is a beautiful country. There's no denying that. But as Tania Hermida (one of Ecuador's premier female filmmakers) put it so astutely, 'un paisaje no es un país.' By that definition I haven't captured much of the country at all. Peace Corps was such a personal and interpersonal experience, but you won't find any people in these pictures save for the occasional rückenfigur. Have I been perpetuating imperialism by only sharing this side of Ecuador, what Hermida calls the 'sinsentido de la imagen turística'? Maybe so. It’s something I’m still wrestling with. If you’re interested, I can recommend some fantastic books and movies that do capture Ecuadorian culture, I can share stories and some people pictures too. But the greatest way to understand Ecuador (or ‘know’ as it in Spanish), is to go there. See places, meet people. That’s life. We live in an amazingly beautiful and diverse world. I don’t know of a place that encapsulates those themes as succinctly as this small Andean nation, but they are 'temas universales.' If my pictures capture anything, I hope it’s that.";}i:69;a:1:{s:14:"comments_count";i:3;}i:70;a:1:{s:11:"likes_count";i:10;}i:71;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu6m9Mn9Hx";}i:72;a:1:{s:5:"image";s:238:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118749499_970001983518248_4935228457793180954_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=108&_nc_ohc=tHJz1RLNcawAX-veWW7&oh=6df0a934131c72ec5b2ce37d2fe03f7a&oe=5F7E13A9";}i:73;a:1:{s:4:"type";s:7:"sidecar";}i:74;a:1:{s:8:"owner_id";i:4181744579;}i:75;a:1:{s:14:"owner_username";s:0:"";}i:76;a:1:{s:14:"owner_fullname";s:0:"";}i:77;a:1:{s:9:"owner_pic";s:0:"";}i:78;a:1:{s:2:"id";s:19:"2391105573686016736";}i:79;a:1:{s:10:"short_code";s:11:"CEu6dnEAvrg";}i:80;a:1:{s:12:"created_time";i:1599262018;}i:81;a:1:{s:7:"caption";s:693:"Clearly not a fan of patel poses but once in a while, i try. The interiors of Little World, Palolem are so instagram worthy, these two forced me into taking pictures while our ‘vegan’ order was being prepared. Also, missing Goa a lot today. That place fills me up with energy (and liquor).
